import React from "react";

function FilterLine(props) {
  const [isChecked, setCheck] = React.useState(false);
  return (
    <div>
      <input
        type="checkbox"
        onChange={() => {
          setCheck(!isChecked);
          props.onChange(isChecked, props.text);
        }}
      />
      {props.text}
    </div>
  );
}

export default FilterLine;
